import { useState, useEffect } from "react";
function ComponentA() {
    const [isCheckedPreCheck, setIsCheckedPreCheck] = useState(false);
    const [isCheckedGitPull, setIsCheckedGitPull] = useState(false);
    const [isCheckedDeployAutomation, setIsCheckedDeployAutomation] = useState(false);
    const [isCheckedVaultSchema, setIsCheckedVaultSchema] = useState(false);
    useEffect(() => {
        setIsCheckedPreCheck(isCheckedGitPull && isCheckedDeployAutomation && isCheckedVaultSchema);
    }, [isCheckedGitPull, isCheckedDeployAutomation, isCheckedVaultSchema]);


    return (
        <>


            <div className="grid grid-cols-1 gap-2">


                <div className="w-[600px] h-[100px] bg-orange-100 rounded-[10px] flex items-start p-4 space-x-4">
                    <input
                        type="checkbox"
                        checked={isCheckedPreCheck}
                        onChange={(e) => setIsCheckedPreCheck(e.target.checked)}
                        className="w-[46px] h-[46px] rounded-md border border-black "
                    />
                    <div>
                        <div className="text-zinc-500 text-xs font-normal tracking-wide">Pre-Check</div>
                        <div className="text-black text-[22px] font-normal mb-1">Pre-Check</div>
                    </div>
                </div>

                <div className="grid grid-cols-1 gap-2">
                    <div className="flex items-center p-4 bg-orange-100 rounded-10px w-150 h-25">
                        <input
                            id="checkbox-1"
                            type="checkbox"
                            checked={isCheckedPreCheck}
                            readOnly
                            className="w-12 h-12 text-blue-600 bg-gray-100 border-gray-300 rounded focus:ring-blue-500 dark:focus:ring-blue-600 dark:ring-offset-gray-800 focus:ring-2 dark:bg-gray-700 dark:border-gray-600"
                        />
                        <label htmlFor="checkbox-1" className="w-full py-4 ml-2 text-sm font-medium text-gray-900 dark:text-gray-300">
                            <div className="text-zinc-500 text-xs font-normal tracking-wide">Pre-Check</div>
                            <div className="text-black text-22px font-normal mb-1">Pre-Check</div>
                        </label>
                    </div>

                    <div className="flex items-center p-4 bg-orange-100 rounded-10px w-150 h-92">
                        <input
                            id="checkbox-2"
                            type="checkbox"
                            checked={isCheckedGitPull}
                            onChange={(e) => setIsCheckedGitPull(e.target.checked)}
                            className="w-12 h-12 text-blue-600 bg-gray-100 border-gray-300 rounded focus:ring-blue-500 dark:focus:ring-blue-600 dark:ring-offset-gray-800 focus:ring-2 dark:bg-gray-700 dark:border-gray-600"
                        />
                        <label htmlFor="checkbox-2" className="w-full py-4 ml-2 text-sm font-medium text-gray-900 dark:text-gray-300">Git Pull</label>

                        <input
                            id="checkbox-3"
                            type="checkbox"
                            checked={isCheckedDeployAutomation}
                            onChange={(e) => setIsCheckedDeployAutomation(e.target.checked)}
                            className="w-12 h-12 text-blue-600 bg-gray-100 border-gray-300 rounded focus:ring-blue-500 dark:focus:ring-blue-600 dark:ring-offset-gray-800 focus:ring-2 dark:bg-gray-700 dark:border-gray-600"
                        />
                        <label htmlFor="checkbox-3" className="w-full py-4 ml-2 text-sm font-medium text-gray-900 dark:text-gray-300">Deploy Automation</label>

                        <input
                            id="checkbox-4"
                            type="checkbox"
                            checked={isCheckedVaultSchema}
                            onChange={(e) => setIsCheckedVaultSchema(e.target.checked)}
                            className="w-12 h-12 text-blue-600 bg-gray-100 border-gray-300 rounded focus:ring-blue-500 dark:focus:ring-blue-600 dark:ring-offset-gray-800 focus:ring-2 dark:bg-gray-700 dark:border-gray-600"
                        />
                        <label htmlFor="checkbox-4" className="w-full py-4 ml-2 text-sm font-medium text-gray-900 dark:text-gray-300">Vault Schema Instantiation</label>
                    </div>
                </div>

            </div>


        </>

    )
}
export default ComponentA
